INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (1, 1, 'Accusantium eius magni voluptatem dolore accusantium vel et.', 'Voluptatem amet vero corporis esse. Nemo eos voluptatum velit. Et nostrum repellat molestiae voluptates.', 'Qui repellat ipsum distinctio occaecati aut accusantium veniam. Accusantium iusto ea natus voluptatem expedita. Laborum sint ducimus et non est et odio. Nihil voluptates eum et dolorem.', '2001-01-12');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (2, 2, 'Eligendi voluptatum totam dolor reprehenderit aperiam.', 'Consequatur enim quam consequatur recusandae enim reprehenderit maiores. Perferendis labore perferendis itaque quia delectus et harum. Repellat sequi ut temporibus accusantium. Cum aut optio perspiciatis nemo et.', 'A sapiente culpa quidem non consequatur esse incidunt. Et ducimus non voluptatum pariatur maiores quae. Qui eaque labore fugit itaque repellendus nam.', '1993-01-26');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (3, 3, 'Corporis corrupti animi ipsa dolore.', 'Deleniti mollitia necessitatibus quod. Tempora sint in quaerat consequatur et fugit hic recusandae. Delectus voluptatem repudiandae repudiandae unde. Error et aperiam accusamus dolores quos excepturi.', 'Perferendis nesciunt amet quas incidunt sunt et. Molestiae sequi alias ut sit nihil voluptatem. Doloremque vel maiores aut totam ut a voluptatem. A aut aliquid at illum et.', '1976-10-15');
